import React, {Component} from 'react';

class Header extends Component {

  state = {
    class: ''
  }

  handleClick = () => {
    if (this.state.class === '') {
      this.setState({
        class: 'block'
      })
    } else {
      navlinkDiv.style.display = '';
    };
  }

  render() {
    return (
      <div className="row nav-row flex-column">
        <header>
          <nav>
            <div className="col name">
              <h1>Ryan K. Collins</h1>
              <div id="line-icon">
                <i className="fas fa-bars fa-2x" onClick={this.handleClick}></i>
              </div>
            </div>
            <div className="col">
              <div className="title-underline"></div>
            </div>
            <div className="col flex-row">
              <h6>Web Developer/Musician</h6>
              <div id="navlink-div" className={this.state.class}>
                <ul>
                  <li>
                    <a href="#about">About</a>
                  </li>
                  <li>
                    <a href="#skills">Skills</a>
                  </li>
                  <li>
                    <a href="#projects">Projects</a>
                  </li>
                </ul>
              </div>
            </div>
          </nav>
        </header>
      </div>
    );
  }

}

export default Header;
